import React from 'react'
import './skills.css'
import UIDesign from '../../assets/ui-design.png';
import WebDesign from '../../assets/website-design.png';
import AppDesign from '../../assets/app-design.png';

const Skills = () => {
  return (
    <section id='skills'>
        <span className="skillTitle">What I do</span>
        <span className="skillDescription">
            I am a skilled and passionate web designer with experience in creating visually appealing and user-friendly websites. 
            I have a strong understanding of design and a keen eye for detail. I am proficient in HTML, CSS, and Javascript, as well 
            as design software such as Adobe Photoshop and Illustrator.
        </span>
        <div className="skillBars">
            <div className="skillBar"></div>
        </div>

    </section>
  )
}

export default Skills
